_Printing_ is not the same as _returning_. The function prints some text but it doesn't return any value. To return something from a function you use the _return_ keyword. The returned value can then be retried and used from the place where function was called.

Here is a simple example of a function that returns an int and shows how you might use it.

int square(int x)
{
    return x * x;
}

int main()
{
    cout << "Please enter a number: ";
    int num;
    cin >> num;
    cout << "The square of " << num << " is " << square(num) << ".\n";

    return 0;
}

@SRKInMyBlood From what I read on Wikipedia, it seems like a dangerous language feature that is too easy to misuse. By using a friend function, you are breaking encapsulation and risking namespace collisions.

